import React, { useState, useEffect } from 'react';
import { Link, useNavigate, useLocation } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';
import { loginWithGoogle } from '../services/authService';
import '../styles/LoginPage.css';

const LoginPage = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);
  const { user, handleLogin, login } = useAuth();
  const navigate = useNavigate();
  const location = useLocation();

  useEffect(() => {
    // Check if user is already logged in
    if (user) {
      const redirectTo = location.state?.from || '/';
      navigate(redirectTo);
    }

    // Check for token in URL (for OAuth redirect)
    const searchParams = new URLSearchParams(location.search);
    const token = searchParams.get('token');
    if (token) {
      handleLogin(token);
      navigate('/');
    }
  }, [user, navigate, location, handleLogin]);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setLoading(true);

    try {
      await login(email, password);
      navigate('/');
    } catch (err) {
      setError(err.message || 'Failed to login');
    } finally {
      setLoading(false);
    }
  };

  const handleGoogleLogin = () => {
    console.log('Initiating Google login...');
    // Using mock authentication - in production this would redirect to real Google OAuth
    alert("DEMO MODE: Using mock Google authentication. In a production environment, this would redirect to a real Google login page.");
    loginWithGoogle();
  };

  return (
    <div className="login-container">
      <div className="login-card">
        <h1>Welcome Back</h1>
        <p className="subtitle">Sign in to your Thrift Store account</p>
        
        {error && <div className="error-message">{error}</div>}
        
        <form onSubmit={handleSubmit} className="login-form">
          <div className="form-group">
            <label htmlFor="email">Email</label>
            <input
              type="email"
              id="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
            />
          </div>
          
          <div className="form-group">
            <label htmlFor="password">Password</label>
            <input
              type="password"
              id="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
            />
          </div>
          
          <button type="submit" className="login-button" disabled={loading}>
            {loading ? 'Signing in...' : 'Sign In'}
          </button>
        </form>
        
        <div className="divider">or</div>
        
        <button 
          onClick={handleGoogleLogin}
          className="google-button"
        >
          <svg width="18" height="18" xmlns="http://www.w3.org/2000/svg">
            <g fill="none" fillRule="evenodd">
              <path d="M17.6 9.2l-.1-1.8H9v3.4h4.8C13.6 12 13 13 12 13.6v2.2h3a8 8 0 0 0 2.6-6.6z" fill="#4285F4" fillRule="nonzero"/>
              <path d="M9 18c2.4 0 4.5-.8 6-2.2l-3-2.2a5.4 5.4 0 0 1-8-2.9H1V13a9 9 0 0 0 8 5z" fill="#34A853" fillRule="nonzero"/>
              <path d="M4 10.7A5.4 5.4 0 0 1 3.3 9H1a9 9 0 0 0 0 4h3.3v2.3z" fill="#FBBC05" fillRule="nonzero"/>
              <path d="M9 3.6c2.8 0 4.3 1.8 4.7 2.8l2.5-2.3A9 9 0 0 0 1 5l3 2.4a5.4 5.4 0 0 1 5-4z" fill="#EA4335" fillRule="nonzero"/>
              <path d="M0 0h18v18H0z"/>
            </g>
          </svg>
          <span>Continue with Google</span>
        </button>
        
        <p className="register-link">
          Don't have an account? <Link to="/register">Sign up</Link>
        </p>
        
        <p className="terms">
          By signing in, you agree to our <Link to="/terms">Terms of Service</Link> and <Link to="/privacy">Privacy Policy</Link>
        </p>
      </div>
    </div>
  );
};

export default LoginPage;
